export const PRIME_LIMIT = 2n**20n;
export const PRIMES = new Set([2n, 3n]);

const bitmap_base64 = '';
const bitmap = Uint8Array.from(atob(bitmap_base64), c => c.charCodeAt(0));

let num = 5n;
let step = 2n;

for (const byte of bitmap) {
  for (let mask = 0b1000_0000; mask > 0; mask >>= 1) {
    if ((byte & mask) !== 0) {
      PRIMES.add(num);
    }

    num += step;
    step = 6n - step;
  }
}
